import React from 'react';

function Header(props){

   const handleLogin = (e) => {
      e.preventDefault()
      props.handleLoginClick(true);
   }

   const handleSignUp = (e) => {
      e.preventDefault()
      props.handleLoginClick(false);
   }

   return <nav>
      <ul>
         <li><h1>KeeperApp</h1></li>
         <li><button onClick = {handleLogin} className = "loginicon">Login</button></li>
         <li><button onClick = {handleSignUp} className = "loginicon">SignUp</button></li>
      </ul>
      </nav>
   
}

export default Header;
